import {createRoot} from "react-dom";


function Myfun(){

  const [name,setName] = useState("Andrew Anderson");

  function changeName(){
    setName("Aryan Sengar")
  }

  return(<>
    <h1>Name : {name}</h1>
    <button onClick={changeName}>Change Name</button>
    </>)
}

createRoot(document.getElementById("demo")).render(<Myfun/>);
